import React from "react";

export default function CheckboxGroup(props) {
  const boxs = props.options.map(o => (
    <label key={o.value}>
      <input type="checkbox" value={props.lovers.includes(o.value)} onChange={e => console.log(e)} />
      {o.label}
    </label>
  ));

  return <div>{boxs}</div>;
}
